module.exports = function(url, callback){
    $.ajax({
		method: "POST",
		url: url,
		dataType: "text",
		cache: false,
		success: function(data){
            callback(data);
		},
		error: function(status){
			console.error(status);
            //callback("Project doesn't exist.");
            callback(new Error(status));
		}
	});
};
